import React from "react";

function Footer() {
  return (
    <footer class="fixed-bottom py-3 bg-dark">
      <div class="container">
        <p class="m-0 text-center text-light">SCEHacks - 2021</p>
      </div>
    </footer>
  );
}

export default Footer;
